import MusicMakerTop from "./MusicMakerTop"
import MusicMakerSheet from "./MusicMakerSheet"
import MusicMakerBottom from "./MusicMakerBottom"

const MusicMakerContainer = ({ notes, arraysLists, instrumentLists, playSong, noteLength, stopBtn, time, setTime }) => {
  return (
    <div id="mainGame" className="flex flex-col items-center">
        <MusicMakerTop />
        <MusicMakerSheet notes={notes} arraysLists={arraysLists} instrumentLists={instrumentLists} noteLength={noteLength} tempo={tempo} setTempo={setTempo}/>
        <MusicMakerBottom playSong={playSong} stopBtn={stopBtn} time={time} setTime={setTime}/>
    </div>
  )
}

export default MusicMakerContainer
